import React from 'react'

class IndexPage extends React.Component {
  render() {
      return (
    <div className="page">
      <h1>Hello World!</h1>
      <img src={'@public/static/favicon.ico'} alt=""/>
      <img src="/image.jpg" alt="my image" />
    </div>
  )
  }
}

export default IndexPage

